    id: number;
    text: string;
    date: string;
}

type Events = {
    events: Event;
}

const Events = ({events}) => {

    return (
        <>
        <h1>hi</h1>
            {events.map((event) => (
                <h3 key={event.id}>{event.text}</h3>
            ))}
        </>
    )
}


